import React from "react";
import Logo from "./logo.png";
function Calculator() {
  return (
    <div>
      <div class="ui inverted teal menu">
        <a href="./" class="active item">
          Home
        </a>
        <a href="./" class="item">
          Messages
        </a>
        <a href="./" class="item">
          Friends
        </a>
        <div class="right menu">
          <a href="./" class="ui item">
            <img src={Logo} alt="#" />
          </a>
        </div>
      </div>
    </div>
  );
}

export default Calculator;
